const LowtoHigh = (Item) => {
  //creating low to high filter
  props.Item.sort(function (a, b) { //take a function to compare two things
    if (parseInt(a.price) > parseInt(b.price)) {
      return 1
    }
    if (parseInt(a.price) < parseInt(b.price)) {
      return -1
    }
  })
}
